import './App.css';
//Using BEM naming convention
import PostData from './data.json';

function dataFiltered() {

  const uniqueData = [];

  PostData.map(() => {

    uniqueData = [...PostData.languages]
  })


  return uniqueData;
}

export default dataFiltered;
